{"object_type": "TweetRaw", "download_datetime": "2023-01-08T19:42:49.241829-08:00", "raw_value": {"created_at": "Sat Jan 07 17:54:27 +0000 2023", "id": 1611783336716042240, "id_str": "1611783336716042240", "full_text": "If someone is salivating over the unsupported use of ivermectin for Covid-19 and pooh-poohing the safe and effective use of Covid-19 vaccines, then that person\u2019s cognitive strings are almost certainly being pulled by propaganda.", "truncated": false, "display_text_range": [0, 228], "entities": {"hashtags": [], "symbols": [], "user_mentions": [], "urls": []}, "source": "<a href=\"http://twitter.com/download/iphone\" rel=\"nofollow\">Twitter for iPhone</a>", "in_reply_to_status_id": null, "in_reply_to_status_id_str": null, "in_reply_to_user_id": null, "in_reply_to_user_id_str": null, "in_reply_to_screen_name": null, "user_id": 50547284, "user_id_str": "50547284", "geo": null, "coordinates": null, "place": null, "contributors": null, "is_quote_status": false, "retweet_count": 34, "favorite_count": 246, "reply_count": 30, "quote_count": 5, "conversation_id": 1611783336716042240, "conversation_id_str": "1611783336716042240", "favorited": false, "retweeted": false, "lang": "en", "supplemental_language": null}}
