{"object_type": "TweetRaw", "download_datetime": "2023-01-08T19:52:31.803417-08:00", "raw_value": {"created_at": "Sat Dec 31 16:37:00 +0000 2022", "id": 1609227129186844675, "id_str": "1609227129186844675", "full_text": "In April 2019, my handle was suspended.\n\nToday, twitter sent me a mail acknowledging that my suspension was a  mistake. They have reinstated my account.\n\nI am glad to be back. I thank all my suppoters and well wishers for their constant  encouragement and support.\n\n\u0938\u0924\u094d\u092f\u092e\u0947\u0935 \u091c\u092f\u0924\u0947", "truncated": false, "display_text_range": [0, 278], "entities": {"hashtags": [], "symbols": [], "user_mentions": [], "urls": []}, "source": "<a href=\"http://twitter.com/download/android\" rel=\"nofollow\">Twitter for Android</a>", "in_reply_to_status_id": null, "in_reply_to_status_id_str": null, "in_reply_to_user_id": null, "in_reply_to_user_id_str": null, "in_reply_to_screen_name": null, "user_id": 4472065032, "user_id_str": "4472065032", "geo": null, "coordinates": null, "place": null, "contributors": null, "is_quote_status": false, "retweet_count": 9826, "favorite_count": 46638, "reply_count": 2217, "quote_count": 653, "conversation_id": 1609227129186844675, "conversation_id_str": "1609227129186844675", "favorited": false, "retweeted": false, "lang": "en", "supplemental_language": null}}
