{"object_type": "TweetRaw", "download_datetime": "2023-01-08T20:51:04.093206-08:00", "raw_value": {"created_at": "Sun Jan 08 08:08:45 +0000 2023", "id": 1611998328329498627, "id_str": "1611998328329498627", "full_text": "Indians are made up of 3 main genetic components: Iranian Farmer (Indus Valley), AASI (SAHG) and Steppe MLBA. Just for fun, I was wondering what happens if you artifically subtract these components one by one from a modern North Indian UC. What would Indians genetically resemble?", "truncated": false, "display_text_range": [0, 280], "entities": {"hashtags": [], "symbols": [], "user_mentions": [], "urls": []}, "source": "<a href=\"https://mobile.twitter.com\" rel=\"nofollow\">Twitter Web App</a>", "in_reply_to_status_id": null, "in_reply_to_status_id_str": null, "in_reply_to_user_id": null, "in_reply_to_user_id_str": null, "in_reply_to_screen_name": null, "user_id": 1065032890856210432, "user_id_str": "1065032890856210432", "geo": null, "coordinates": null, "place": null, "contributors": null, "is_quote_status": false, "retweet_count": 15, "favorite_count": 233, "reply_count": 12, "quote_count": 2, "conversation_id": 1611998328329498627, "conversation_id_str": "1611998328329498627", "favorited": false, "retweeted": false, "lang": "en", "supplemental_language": null, "self_thread": {"id": 1611998328329498627, "id_str": "1611998328329498627"}}}
