{"object_type": "TweetRaw", "download_datetime": "2023-01-08T20:51:12.462314-08:00", "raw_value": {"created_at": "Fri Dec 30 01:36:04 +0000 2022", "id": 1608638015248936962, "id_str": "1608638015248936962", "full_text": "An exercise in distal modelling of publicly available Indian populations as a 3-way admixture with qpAdm:\n\n1) Paleolithic hunter gatherers\n2) Neolithic Iranian farmers\n3) Bronze Age Steppe pastoralists\n\nActual admixing populations were different\n\n1/10", "truncated": false, "display_text_range": [0, 251], "entities": {"hashtags": [], "symbols": [], "user_mentions": [], "urls": []}, "source": "<a href=\"https://mobile.twitter.com\" rel=\"nofollow\">Twitter Web App</a>", "in_reply_to_status_id": null, "in_reply_to_status_id_str": null, "in_reply_to_user_id": null, "in_reply_to_user_id_str": null, "in_reply_to_screen_name": null, "user_id": 799723122777845769, "user_id_str": "799723122777845769", "geo": null, "coordinates": null, "place": null, "contributors": null, "is_quote_status": false, "retweet_count": 10, "favorite_count": 41, "reply_count": 2, "quote_count": 6, "conversation_id": 1608638015248936962, "conversation_id_str": "1608638015248936962", "favorited": false, "retweeted": false, "lang": "en", "supplemental_language": null, "self_thread": {"id": 1608638015248936962, "id_str": "1608638015248936962"}}}
